import { Container, makeStyles, Button, Typography } from '@material-ui/core'

const useStyles = makeStyles({
    btn : {
        background : 'cyan',
        color : 'navy',
        '&:hover' : {
            background : 'green',
            color : 'yellow'
        }
    }
})

const Test2 = () =>{
    const styles = useStyles()

    return(
        <Container>
            <Typography variant="h3">Using the "useStyles" hook</Typography>
            <Button className={styles.btn}>Made with style</Button>
        </Container>
    )
}

export default Test2
